import React, {
  Component
} from 'react'
import TextBox from '../../components/TextBox/TextBox'
import { properties, fSize, fWeight } from '../../conf/properties'
import Header from '../../components/Header/Header'
import HeaderDown from '../../components/Header/HeaderDown'
import Footer from '../../components/Footer/Footer'
import FooterDown from '../../components/Footer/FooterDown'
import styled from 'styled-components'

const MainWrapper = styled.div`
  padding : 24px 0px;
  display: flex;
  flex-direction: row;
  justify-content: center;
  height: 500px;
`
const SubWrapper1 = styled.div`
  width: 60%;
  height: inherit;
  background-color : ${properties.white};
  display: flex;
  flex-direction: row;
  padding: 0px 12px;
`
const SubWrapper2 = styled.div`
  width: 30%;
  height: inherit;
  background-color : ${properties.white};
  display: flex;
  flex-direction: row;
  padding: 0px 12px;
`
const Subw1In1 = styled.div`
  width: 100%;
  height: inherit;
  background-color : ${properties.white};
  display: flex;
  flex-direction: row;
  padding: 0px 12px;
`
const Subw1In2 = styled.div`
  border : 1px solid rgba(0, 40, 100, 0.12);
  width: 100%;
  height: inherit;
  background-color : ${properties.white};
  display: flex;
  flex-direction: row;
`
const Timeline = styled.div`
  border-bottom : 1px solid rgba(0, 40, 100, 0.12);
  width: 100%;
  height: 56px;
  /* background-color : ${properties.otherBlue}; */
  padding: 8px 24px;
  display: flex;
  flex-direction: row;
  align-items: center;
`
const SocialMedia = styled.div`
  width: 50%;
  height: 56px;
  background-color : ${properties.otherBlue};
  padding: 8px 24px;
  display: flex;
  flex-direction: row;
  align-items: center;
`


class Home extends Component {
  render() {
    return (<div>
      <Header />
      <HeaderDown />
      <MainWrapper >
        <SubWrapper1>
          <Subw1In1>
            <Subw1In2>
              <Timeline>
                <TextBox
                  color={properties.littleLightGrey}
                  fontSize={fSize.slarge}
                >
                  Timeline
                    </TextBox>
              </Timeline>
              <SocialMedia>

              </SocialMedia>
            </Subw1In2>
          </Subw1In1>

        </SubWrapper1>
        <SubWrapper2>
          <Subw1In1>
            <Subw1In2>
              <Timeline>
                <TextBox
                  color={properties.littleLightGrey}
                  fontSize={fSize.slarge}
                >
                  Venue
                    </TextBox>
              </Timeline>
            </Subw1In2>
          </Subw1In1>
        </SubWrapper2>
      </MainWrapper>

      <Footer />
      <FooterDown />
    </div >
    )
  }
}

export default Home
